description:
Recently sold: $215,000. 2+ bdrm/ 2 bath w Attached 1C garage. Great location in Congdon neighborhood. Fresh paint, older carpet, open layout. 4-Season Sunroom w/ lots of light, can double as office or guest room. Dual-sided gas fireplace in dining and living room. Laundry on main level. Attached garage leads directly to both kitchen and main entry. Lots of great closet space and storage in lower level.
*Some older images available online

Available 1/1 for 5-6 mos short-term, then negotiable extension yr to yr. Tenant pays all utilities. Owner pays garbage, lawn care, and snow removal over 6&quot;
